import React from 'react';
import placeHolder from './placeHolderMandelbrot.jpg'

var Blur = require('react-blur');

class Overlay extends React.Component {
    constructor(props) {
        super(props);
    }

 render() {

        return(
        <React.Fragment>
              <Blur className='blur-demo' img={placeHolder} blurRadius={5}>

              </Blur>
              </React.Fragment>
        );
      }
  }
export default Overlay;
